,(6,3975,"mbri-mobirise","Telemedicine & Remote Consultations","Dr. Schenker Jean-Martin offers telemedicine services to provide convenient and efficient healthcare from the comfort of your home. With secure video consultations, you can discuss your health concerns, receive medical advice, and follow up on treatment plans without needing to visit the clinic. This service is perfect for patients seeking flexible and immediate care","1","2024-11-05 12:38:15","2024-11-05 13:09:25")
,(7,3975,"mbri-hearth","Onsite Clinic Consultations","Experience comprehensive care at Dr. Schenker Jean-Martinâ€™s clinic. Onsite consultations ensure you receive thorough assessments, in-person examinations, and immediate medical attention. The clinic is equipped to handle a variety of medical needs, from routine check-ups to more detailed diagnoses.\r\n\r\nKey features include:\r\n\r\nPersonal, face-to-face interaction\r\nAccess to in-depth medical evaluations and tests\r\nA welcoming environment for discussing your health concerns\r\nVisit the clinic for reliable and personalized healthcare. Book your appointment and receive expert care tailored to your needs.","1","2024-11-05 12:39:31","2024-11-05 13:08:45")
,(8,3975,"mbri-info","Health Screening and Preventative Care","Stay ahead of potential health issues with our comprehensive health screening and preventative care services. Dr. Schenker Jean-Martin emphasizes the importance of regular check-ups to monitor your health, identify risks early, and maintain overall wellness. Our tailored screening programs include blood tests, physical examinations, and personalized health assessments to ensure you and your family are on the path to a healthier life.","1","2024-11-05 13:07:13","2024-11-05 13:09:49")
